import React, {useState} from 'react';
import Styles from './App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
    // const [show, setShow] = useState(true);

    return (
        <Container style={{overflow:'hidden'}} fluid>
            <Row>
            <Col xs={{ order: 'last',offset:1 }} xs>First, but unordered</Col>
            <Col xs={{ offset:1 }}>ddd, but last</Col>
            <Col xs={{offset:2 }}>Second, but last</Col>
            <Col xs={{offset:3 }}>Second, but last</Col>
            <Col xs={{offset:4 }}>Second, but last</Col>
            <Col xs={{offset:5 }}>Second, but last</Col>
            <Col xs={{offset:6 }}>Second, but last</Col>
            <Col xs={{offset:7 }}>Second, but last</Col>

            </Row>
        </Container>
    );
}

export default App;
